import "./App.css";
import Input from "./components/input";

function App() {
  return (
    <div className="flex justify-center">
      <div className="w-[45rem] h-[45rem] border-double border-2 border-zinc-900 rounded px-2 py-2">
        <Input></Input>
      </div>
    </div>
  );
}

export default App;
